import React from 'react';
import { Navigate, Route, Routes } from 'react-router-dom';
import ThemeJss from '../theme';

const SiteRoute: React.FC = () => {
    return (
        <ThemeJss>
            <Routes>
                <Route index element={<Navigate to='home' />} />
               
            </Routes>
        </ThemeJss>
    );
};

export default SiteRoute;
